import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Set a mobile viewport to trigger the mobile menu layout
    await page.setViewportSize({ width: 375, height: 667 });

    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial_mobile_view.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial_mobile_view.png'));

    // Find and click the "All" menu button to open the mobile menu
    const menuTrigger = page.locator('div.nav-menu:has-text("All")');
    await menuTrigger.waitFor({ state: 'visible', timeout: 5000 });
    await menuTrigger.click();

    // Wait for the mobile menu overlay to become visible
    const menuOverlay = page.locator('#mobileMenuOverlay');
    await menuOverlay.waitFor({ state: 'visible', timeout: 5000 });

    // Take a screenshot of the open menu
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_mobile_menu_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_mobile_menu_open.png'));

    // Extract the text of the first few links in the menu for verification
    const menuLinks = await page.locator('.mobile-menu a').all();
    const extractedData = {
      menuLink1: await menuLinks[0].innerText(),
      menuLink2: await menuLinks[1].innerText(),
      menuLink3: await menuLinks[2].innerText(),
    };

    // Find and click the close button within the mobile menu
    const closeButton = page.locator('.mobile-menu .close-mobile-menu');
    await closeButton.waitFor({ state: 'visible', timeout: 5000 });
    await closeButton.click();

    // Wait for the mobile menu overlay to be hidden
    await menuOverlay.waitFor({ state: 'hidden', timeout: 5000 });

    // Take a final screenshot to confirm the menu is closed
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_mobile_menu_closed.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_mobile_menu_closed.png'));

    return {
      success: true,
      action: "Successfully opened, verified, and closed the mobile menu.",
      extractedData,
      screenshots,
      error: null
    };
  } catch (error) {
    // In case of an error, take a final screenshot for debugging
    await page.screenshot({ path: path.join(screenshotsDir, 'error_screenshot.png') });
    return {
      success: false,
      action: "Failed to test mobile menu navigation",
      extractedData: {},
      screenshots: [path.join(screenshotsDir, 'error_screenshot.png')],
      error: error.message
    };
  }
}
